import React from 'react';
import {BrowserRouter as Router, Link} from 'react-router-dom';
import Footer from "./Footer";

const Shop = () => {
    return(<div class = "page">
            <div class = "title">
                <p> Shop For:</p>
            </div>

                  <nav>
        <Link to="./Totes"><img class = "productPicture" src={require("./images/lemontote.jpg")}/></Link>
        <Link to="/Stickers"><img class = "productPicture" src={require("./images/peachSticker.jpg")}/></Link>
      </nav>
        </div>
        )
};

export default Shop;
